drop database if exists `mp1wuwmz3yjsrqmz`;
create database `mp1wuwmz3yjsrqmz`;
USE `mp1wuwmz3yjsrqmz`;

CREATE TABLE Usertrees
(
    id int not null auto_increment,
    latitude varchar (255),
    longitude varchar (255),
    tree_image_link varchar (255),
    date_planted date,
    name_of_tree varchar (255),
    users_tree_name varchar (255),
    treename varchar (255),
    treetype varchar (255),
    UserId int,
    createdAt TIMESTAMP default CURRENT_TIMESTAMP,
    updatedAt TIMESTAMP,
    primary key (id)
);

CREATE TABLE Users
(
    id int not null auto_increment,
    firstName varchar (255),
    lastName varchar (255),
    dob date,
    city varchar (255),
    state varchar (255),
    country varchar (255),
    profile_image_link varchar (255),
    email varchar (255),
    password varchar (255),
    isAdmin boolean default 0,
    createdAt TIMESTAMP default CURRENT_TIMESTAMP,
    updatedAt TIMESTAMP,
    primary key (id)
);



